<style>
  rs-map svg {
    display: block;
    height: 100vh;
    width: 100vw;
    /*width: auto;
      float: right;*/
    background: #c6ecff;
  }

  rs-map svg path {
    fill: var(--color-panel);
    stroke: var(--color-text-pale);
    stroke-width: 4;
    stroke-linecap: round;
    stroke-linejoin: round;
    transition: fill 500ms;
  }

  rs-map svg g:not(.inert) {
    cursor: pointer;
  }

  rs-map svg g:not(.inert):hover path {
    fill: var(--color-accent);
    transition: fill 150ms;
    cursor: pointer;
  }

  rs-map svg g.inert path {
    fill: var(--color-background);
    stroke-width: 4;
  }
</style>
